pick(match(v_ViewUptake, 'FIRST', 'SECOND', 'ADD', 'ADD2', 'NFIRST', 'NSECOND', 'NADD', 'NADD2', 'NPROP'),
    if( sum({<[Age Group]={"*<18*"}, [Member State]=>}  Dose1st_AGE) > 0 AND sum({<[Age Group]={"*<18*"}, [Member State]=>} Uptake1st_AGE) < 0.000001,
    	num(0, '0.0%;-0.0%)'),    num(sum({<[Age Group]={"*<18*"}, [Member State]=>} Uptake1st_AGE), '0.0%;-0.0%;-')),
	if( sum({<[Age Group]={"*<18*"}, [Member State]=>}  Dose1st_AGE) > 0 AND sum({<[Age Group]={"*<18*"}, [Member State]=>} Uptake2nd_AGE) < 0.000001,
    	num(0, '0.0%;-0.0%)'),    num(sum({<[Age Group]={"*<18*"}, [Member State]=>} Uptake2nd_AGE), '0.0%;-0.0%;-')),
    if( sum({<[Age Group]={"*<18*"}, [Member State]=>}  DoseAdd_AGE) > 0 AND sum({<[Age Group]={"*<18*"}, [Member State]=>} UptakeAdd_AGE) < 0.000001,
    	num(0, '0.0%;-0.0%)'),    num(sum({<[Age Group]={"*<18*"}, [Member State]=>} UptakeAdd_AGE), '0.0%;-0.0%;-')),
    if( sum({<[Age Group]={"*<18*"}, [Member State]=>}  DoseAdd2_AGE) > 0 AND sum({<[Age Group]={"*<18*"}, [Member State]=>} UptakeAdd2_AGE) < 0.000001,
    	num(0, '0.0%;-0.0%)'),    num(sum({<[Age Group]={"*<18*"}, [Member State]=>} UptakeAdd2_AGE), '0.0%;-0.0%;-')),

    num(sum({<EU27_EEA=P(EU27_EEA), [Member State]=>}0) + sum({<[Age Group]={"*<18*"}, [Member State]=>}  Dose1st_AGE), '#,##0;-#,##0;-'),
    num(sum({<EU27_EEA=P(EU27_EEA), [Member State]=>}0) + sum({<[Age Group]={"*<18*"}, [Member State]=>} Dose2nd_AGE), '#,##0;-#,##0;-'),
    num(sum({<EU27_EEA=P(EU27_EEA), [Member State]=>}0) + sum({<[Age Group]={"*<18*"}, [Member State]=>} DoseAdd_AGE), '#,##0;-#,##0;-'),
    num(sum({<EU27_EEA=P(EU27_EEA), [Member State]=>}0) + sum({<[Age Group]={"*<18*"}, [Member State]=>} DoseAdd2_AGE), '#,##0;-#,##0;-'),

    num(sum({<EU27_EEA=P(EU27_EEA), [Member State]=>}0) + Sum({< [Age Group]={"*<18*"},  [Member State]=>}DoseTotal_AGE) / sum(Total <[Member State]> {<[Member State]=>} DoseTotal_AGE), '0.0%;-0.0%;-')
)

